import React, { useState } from "react";
export default function Form(props) {
  const [url, setUrl] = useState("");

  const handleSubmit = (evt) => {
    evt.preventDefault();
    alert(`Submitting Name ${url}`);
  };

  return (
    <>
    <form onSubmit={handleSubmit}></form>
      <label>
        <input type="text" />
      </label>
      <input type="submit" value="Submit" />
    </>
  );
}
